import React from "react";

function DisplayData() {
    fetch('https://api.github.com/orgs/nodejs', {
    method: 'GET',
    })
    .then(response => {
    return response.json();
    })
    .then(data => {
    console.log(data);
    });
}
export default DisplayData;
